                disjoint.byrank(ord(eq[0]) - 97, ord(eq[3]) - 97)
            else:
                if eq[0] == eq[3]:
                    return False
                nq.append(eq)

        for eq in nq:
            x = ord(eq[0]) - 97
            y = ord(eq[3]) - 97
            if disjoint.finduPar(x) == disjoint.finduPar(y):
                return False

        return True

